import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { BuildingOfficeIcon, EyeIcon, EyeSlashIcon } from '@heroicons/react/24/outline';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    isAdmin: false
  });
  const [showPassword, setShowPassword] = useState(false);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  
  const { login } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const result = login(formData.email, formData.password, formData.isAdmin);
      
      if (result.success) {
        navigate(formData.isAdmin ? '/admin' : '/dashboard');
      } else {
        setError(result.error);
      }
    } catch (err) {
      setError('An unexpected error occurred. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-50 py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-md w-full space-y-8">
        <div className="text-center">
          <div className="flex justify-center">
            <BuildingOfficeIcon className="h-12 w-12 text-construction-blue" />
          </div>
          <h2 className="mt-6 text-3xl font-display font-bold text-construction-gray">
            Hanover & Tyke
          </h2>
          <p className="mt-2 text-sm text-construction-gray-light">
            Construction Task Management System
          </p>
          <h3 className="mt-6 text-xl font-medium text-construction-gray">
            Sign in to your account
          </h3>
        </div>
        
        <form className="mt-8 space-y-6" onSubmit={handleSubmit}>
          <div className="card">
            {error && (
              <div className="mb-4 p-3 bg-construction-red bg-opacity-10 border border-construction-red rounded-lg">
                <p className="text-construction-red text-sm">{error}</p>
              </div>
            )}
            
            <div className="space-y-4">
              <div>
                <label htmlFor="email" className="block text-sm font-medium text-construction-gray mb-1">
                  Email address
                </label>
                <input
                  id="email"
                  name="email"
                  type="email"
                  autoComplete="email"
                  required
                  className="input-field"
                  value={formData.email}
                  onChange={handleChange}
                  placeholder="Enter your email"
                />
              </div>
              
              <div>
                <label htmlFor="password" className="block text-sm font-medium text-construction-gray mb-1">
                  Password
                </label>
                <div className="relative">
                  <input
                    id="password"
                    name="password"
                    type={showPassword ? 'text' : 'password'}
                    autoComplete="current-password"
                    required
                    className="input-field pr-10"
                    value={formData.password}
                    onChange={handleChange}
                    placeholder="Enter your password"
                  />
                  <button
                    type="button"
                    className="absolute inset-y-0 right-0 pr-3 flex items-center"
                    onClick={() => setShowPassword(!showPassword)}
                  >
                    {showPassword ? (
                      <EyeSlashIcon className="h-5 w-5 text-construction-gray-light" />
                    ) : (
                      <EyeIcon className="h-5 w-5 text-construction-gray-light" />
                    )}
                  </button>
                </div>
              </div>
              
              <div className="flex items-center">
                <input
                  id="isAdmin"
                  name="isAdmin"
                  type="checkbox"
                  className="h-4 w-4 text-construction-blue focus:ring-construction-blue-light border-construction-gray-lighter rounded"
                  checked={formData.isAdmin}
                  onChange={handleChange}
                />
                <label htmlFor="isAdmin" className="ml-2 block text-sm text-construction-gray">
                  Admin login
                </label>
              </div>
            </div>
            
            <div className="mt-6">
              <button
                type="submit"
                disabled={loading}
                className="w-full btn-primary disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {loading ? 'Signing in...' : 'Sign in'}
              </button>
            </div>
            
            <div className="mt-4 text-center">
              <p className="text-sm text-construction-gray-light">
                Demo credentials:
              </p>
              <p className="text-xs text-construction-gray-light mt-1">
                Admin: admin@hanover-tyke.com / admin123
              </p>
              <p className="text-xs text-construction-gray-light">
                User: Register any account
              </p>
            </div>
          </div>
        </form>
        
        <div className="text-center">
          <p className="text-sm text-construction-gray-light">
            Don't have an account?{' '}
            <Link to="/register" className="font-medium text-construction-blue hover:text-construction-blue-light">
              Sign up
            </Link>
          </p>
        </div>
        
        <div className="text-center">
          <div className="inline-flex items-center px-3 py-1 rounded-full text-sm font-medium bg-hard-hat-yellow text-construction-blue">
            <span className="mr-1">ðŸ”¨</span>
            10% OFF New Projects
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
